import React from 'react';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { render } from "react-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate
} from "react-router-dom";
import Login from "./routes/login/index";
import Register from "./routes/register/index";
import ForgotPassword from "./routes/forgot-password/index";
import Home from "./routes/home/index";
import OnGoingActivity from "./routes/on-going-activity/index";
import History from "./routes/history/index";
import Profile from "./routes/profile/index";
import Services from "./routes/services/index";
import CashIn from "./routes/cash-in/index";
import Default from "./routes/default/index";
import Weather from "./routes/weather/index";
import registerServiceWorker from "./registerServiceWorker";
import { Auth0Provider } from '@auth0/auth0-react';
import { useAuth0 } from '@auth0/auth0-react';
const {
  isAuthenticated,
  loginWithRedirect, logout, user
} = useAuth0();
render(

  <Auth0Provider
    domain="dev-laraine.us.auth0.com"
    clientId="ZNv0AZoPVfNsB0tQNihJa2pogfsmnoOm"
    redirectUri={window.location.origin + "/home"}
  >
    <BrowserRouter>
      <Routes>
        <Route path="/" element={isAuthenticated != null ? <Home /> : <Navigate to="/login" />} />
        <Route path="login" element={<Default />} />
        <Route path="register" element={<Register />} />
        <Route path="weather" element={<Weather />} />
        <Route path="forgot-password" element={<ForgotPassword />} />
        <Route path="home" element={localStorage.getItem("session") != null ? <Home /> : <Navigate to="/login" />} />
        <Route path="on-going-activity" element={localStorage.getItem("session") != null ? <OnGoingActivity /> : <Navigate to="/login" />} />
        <Route path="history" element={localStorage.getItem("session") != null ? <History /> : <Navigate to="/login" />} />
        <Route path="profile" element={localStorage.getItem("session") != null ? <Profile /> : <Navigate to="/login" />} />
        <Route path="services" element={localStorage.getItem("session") != null ? <Services /> : <Navigate to="/login" />} />
        <Route path="cash-in" element={localStorage.getItem("session") != null ? <CashIn /> : <Navigate to="/login" />} />
      </Routes>
    </BrowserRouter>
  </Auth0Provider>,
  document.getElementById('root')
);



// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
